import React from 'react';

class Nav extends React.Component{
    render(){
        return(
            <nav className="nav"> 
            <div className="container">
            <ul>
                    <li>Online courses</li>
                    <li>Studying online</li>
                    <li>How to apply</li>
                    <li>Course fees</li>
                    <li>Blog</li>
                </ul>
                </div>           
            </nav>
        );
    }
}

export default Nav;
